import UIKit

class ExpenseViewController: UIViewController { 
 // MARK: - Variables
 var expenses = [Expense]() 

 @IBOutlet weak var tableView: UITableView! 

 // MARK: - UIViewController
 override func viewDidLoad() {
 super.viewDidLoad()

 tableView.dataSource = self 
 tableView.delegate = self 
 setUpNavigationBar() 
 } 

 // MARK: - Private Functions 
 func setUpNavigationBar() { 
 let addButton = UIBarButtonItem(barButtonSystemItem: .add, target: self, action: #selector(addButtonTapped)) 
 navigationItem.setRightBarButton(addButton, animated: true) 
 } 

 @objc func addButtonTapped() { 
 let expenseDetailViewController = ExpenseDetailViewController() 
 expenseDetailViewController.delegate = self 
 present(expenseDetailViewController, animated: true, completion: nil)
 } 
}

extension ExpenseViewController: UITableViewDataSource { 
 func tableView(_ tableView: UITableView, numberOfRowsInSection section: Int) -> Int { 
 return expenses.count 
 } 

 func tableView(_ tableView: UITableView, cellForRowAt indexPath: IndexPath) -> UITableViewCell {
 let cell = tableView.dequeueReusableCell(withIdentifier: "expenseCell", for: indexPath) 
 let expense = expenses[indexPath.row] 
 cell.textLabel?.text = expense.name 
 cell.detailTextLabel?.text = expense.ammount 
 return cell 
 } 
}

extension ExpenseViewController: UITableViewDelegate { 
 func tableView(_ tableView: UITableView, didSelectRowAt indexPath: IndexPath) { 

 } 
}

extension ExpenseViewController: ExpenseDetailViewControllerDelegate { 
 func expenseDetailViewController(_ controller: ExpenseDetailViewController, didCreateExpense expense: Expense) { 
  expenses.append(expense) 
  tableView.reloadData() 
 } 
}

public class Library {

 // map of books in the library, key is book id, value is Book object
 private Map<String, Book> books;

 // Constructor
 public Library() {
  books = new HashMap<>();
 }

 public void addBook(Book book) {
  books.put(book.getId(), book);
 }

 public boolean hasBook(String bookId) {
  return books.containsKey(bookId);
 }

 public void borrowBook(String bookId) {
  Book book = books.get(bookId);
  if (book != null) {
   book.borrow();
  }
 }

}

