class PrimeNumber {
 public static void main(String a[]) {
 int n = 10;
 int i;
 int j;
 System.out.print("Prime numbers between 1 and " + n + " are : ");
 for (i = 1; i < n; i++) {
 int counter = 0;
 for (j = i; j >= 1; j--) {
 if (i % j == 0) {
 counter = counter + 1;
 }
 }
 if (counter == 2) {
 System.out.print(i + " ");
 }
 }
 }
}
// Output: Prime numbers between 1 and 10 are : 2 3 5 7

