def reverse_string(string):
    # Reverse the string
    if len(string) == 0: 
        return string 
    else: 
        return reverse_str(string[1:]) + string[0]

import random
import string

def generateRandomString(n):
    letters = string.ascii_lowercase
    return ''.join(random.choice(letters) for i in range(n))
